import axios from "axios";
import React from "react";
import { useEffect } from "react";

const Home = () => {
  useEffect(() => {
    const allProducts = async () => {
      const { data } = await axios.get("http://localhost:9000/data");
      console.log(data);
    };
    allProducts();
  }, []);

  return <div></div>;
};

export default Home;
